:text: |
  Descendants of WILLIAMS, Henry and COLDHAM, Marianne
  JWILLIAMS, Edward Marsh and DAVIS, Jane
  JWILLIAMS, Henry Edward and CONNELL, Isabelle Annie
  JWILLIAMS, Ernest Harry and CANN, Marion Elizabeth
  WILLIAMS, Letty Martyn and O'RORKE, Forbes
  JO'RORKE, Edith Jacqueline and DUNCAN, John David
  01> O'RORKE, Edith Jacqueline m on 02.09.1961 to DUNCAN, John David
  b 13.12.1932
  b 11.12.1925
  Jacqueline b. at Darfield, Canterbury and m. at Waipawa. John, slo David Low Duncan and Jean
  Douglas, Address: PO Box 8178, Havelock North.
  Jacqueline was educated at Rangi Ruru School in Christchurch and Craighead School in Timaru.
  John was educated at Hereworth School in Havelock North and Wanganui Collegiate School. He was a
  public servant with the Ministry of Agriculture and fisheries in Hastings until his retirement.
  01> DUNCAN, Belinda Jane m on 09.02.1996 to WILLIAMS, Andrew John
  b 22.08.1962
  b 29.08.1965
  Jane b. at Hastings and m. at Havelock North. Andrew, s/o John William Stuart Williams and
  Joanna Jane Strachan. Address: PO Box 191, Hastings.
  Refer to Andrew's entry in this book for biographies and descendants of Jane and Andrew.
  02> DUNCAN, Forbes David Jasper
  b 15.09.1964
  Forbes b. at Hastings. Address: PO Box 8178, Havelock North.
  Forbes was educated at Hereworth School, Havelock North and Wanganui Collegiate School and is
  now an orchard foreman. He is a member of the Havelock North Dog Training Club and is a
  committee member of the Hawkes Bay RSPCA.
  02> O'RORKE, Mary Letitia
  b 26.11.1939
  Mary b. at Dunedin. Address: 6 Shirley Street, Karori, Wellington.
  Mary was educated at Craighead School, Timaru, and Woodford House, Havelock North. She trained as
  a kindergarten teacher in Wellington and later as an interior designer in London.
  01> WILLIAMS, Letty Martyn m on 24.02.1945 to (2) HERRICK, Jasper Lucas
  b 25.01.1906 d 05.12.1993
  b 10.10.1910
  Letty m. at Christchurch and d. and bd. at Havelock North. Jasper, s/o Edward Jasper Herrick and Ethne
  Rose Smith. Address: Muritai, 68 Duart Road, Havelock North.
  Jasper was educated at Hurworth School, Wanganui, and Wanganui Collegiate School. He was a farmer and
  established Tautane Aberdeen Angus Stud near Waipukurau.
  02> WILLIAMS, Barbara Isabel Martyn m on 28.11.1944 to CHAPMAN, George Palmer
  b 06.01.1909 d 29.06.1985
  b 26.09.1903 d 06.11.1988
  Barbara b. and m. at St Matthew's Church, Dunedin and cremated at Timaru.
  George, s/o Edward Palmer Chapman and Ethel Mary Gray, b., d. and cremated at
  Timaru.
  Barbara was educated at St Hilda's School, Dunedin, and Craighead School,
  Timaru. She then studied dance and drama in London and taught in Dunedin.
  She worked in the Army Ciphers Office in Wellington during WW2.
  George was a solicitor in Timaru. During WW2 he served in the Pacific in the 30th Battalion in the
  legal section.
